import React from 'react';
import { useState } from 'react';
// import Card from './Card';
let listMapped = '';
const App = () => {
  const numbers = [1, 4, 6, 8, 45, 89];
  const [data, setData] = useState({
    value: '',
  });
  const handleValue = (ev) => {
    setData({ value: ev.currentTarget.value });
    getNumber();
  };
  const lis = numbers.map((number) => <li> {number}</li>);
  const getNumber = () => {
    numbers.map((n) => {
      if (n >= data.value) {
        listMapped = <li>{n}</li>;
      }
    });
  };
  return (
    <>
      <ul>{lis}</ul>
      <form>
        <input type='text' value={data.value} onChange={handleValue}></input>
      </form>
      <p>{listMapped}</p>
    </>
  );
};
export default App;
